import WineDisplay from "../Components/WineDisplay.js";
import twentyWines from "../Data/wine_data.js";
import "./Results.css";

function ResultsPage() {
  return (
    <div class="grid">
      {twentyWines.map((wine) => {
        return (
          <div>
            <WineDisplay
              iD={wine.iD}
              name={wine.name}
              type={wine.type}
              year={wine.year}
              region={wine.region}
              price={wine.price}
              sweetness={wine.sweetness}
              image={wine.image}
            />
          </div>
        );
      })}
    </div>
  );
}

export default ResultsPage;
